import * as Sentry from "@sentry/react";

function init() {
  Sentry.init({
    dsn:
      "https://f745028c6b0a488d81a1bd8b4652d7e1@o429907.ingest.sentry.io/5377357",
  });
}

function log(error) {
  Sentry.captureException("Logging the error", error);
  console.log(error);
}

export default {
  init,
  log,
};
